CREATE TABLE `other_recommendations` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `product_id` int(11) NOT NULL,
  `recommended_product_id` int(11) NOT NULL,
  `created` datetime DEFAULT NULL,
  `updated` datetime DEFAULT NULL,
  PRIMARY KEY (`id`),
  KEY `fk_other_recommendations_products_1_INDEX` (`product_id`),
  KEY `fk_other_recommendations_products_2_INDEX` (`recommended_product_id`),
  CONSTRAINT `fk_other_recommendations_products_1` FOREIGN KEY (`product_id`) REFERENCES `products` (`id`) ON DELETE NO ACTION ON UPDATE NO ACTION,
  CONSTRAINT `fk_other_recommendations_products_2` FOREIGN KEY (`recommended_product_id`) REFERENCES `products` (`id`) ON DELETE NO ACTION ON UPDATE NO ACTION
) ENGINE=InnoDB AUTO_INCREMENT=2143 DEFAULT CHARSET=utf8;
