style=\"width: 904px; height: 455px; \" /></a></div>\r\n<ul>\r\n	<li>\r\n		<h1 class=\"titulos_gris twCenMt\">\r\n			COLECCIONES&nbsp;</h1>\r\n		<a class=\"fotos_pequenas\" href=\"http://www.colorstennis.com/marcas/panic/subcategoria:15\" target=\"_blank\"><img alt=\"\" src=\"/app/webroot/wysiwyg/KPNC-0056.jpg\" style=\"width: 208px; height: 104px; \" /></a>\r\n		<h2 class=\"titulos_rosado\">\r\n			PANIC PARA HOMBRES</h2>\r\n		<p>\r\n			Esqueletos y camisetas podr&aacute;s encontrar<br />\r\n			tambi&eacute;n en panic funstyle.<br />\r\n			&nbsp;</p>\r\n	</li>\r\n	<li>\r\n		<h1 class=\"titulos_gris twCenMt\">\r\n			P&Oacute;NTELO</h1>\r\n		<a class=\"fotos_pequenas\" href=\"http://www.colorstennis.com/marcas/erre-tres/subcategoria:13\" target=\"_blank\"><img alt=\"\" src=\"/app/webroot/wysiwyg/SAE-A2(2).jpg\" style=\"width: 208px; height: 104px; \" /></a>\r\n		<h2 class=\"titulos_rosado\">\r\n			INVIERNO</h2>\r\n		<p>\r\n			Tambi&eacute;n en invierno ponte a la moda<br />\r\n			con los sacos de Erre Tres.<br />\r\n			&nbsp;</p>\r\n	</li>\r\n	<li>\r\n		<h1 class=\"titulos_gris twCenMt\">\r\n			COMBINA&nbsp;</h1>\r\n		<a class=\"fotos_pequenas\" href=\"http://www.colorstennis.com/marcas/motoneta/subcategoria:17\" target=\"_blank\"><img alt=\"\" src=\"/app/webroot/wysiwyg/sdfdsfsdfds.jpg\" style=\"width: 208px; height: 104px; \" /></a>\r\n		<h2 class=\"titulos_rosado\">\r\n			CHIFLADAS</h2>\r\n		<p>\r\n			La colecci&oacute;n Noviembre para mujer de,<br />\r\n			Motoneta esta mas loca que nunca.<br />\r\n			&nbsp;</p>\r\n	</li>\r\n	<li class=\"puntos\">\r\n		<h3 class=\"subtitulos_gris twCenMt\">\r\n			<span style=\"color:#ff036f;\">Colors Tennis en&nbsp;</span><span style=\"color:#3262c9;\">Facebook</span></h3>\r\n		<h1 class=\"fan_page twCenMt\">\r\n			&nbsp;</h1>\r\n		<div class=\"fb-like\" data-href=\"https://www.facebook.com/ColorsTennis\" data-layout=\"box_count\" data-send=\"false\" data-show-faces=\"false\" data-width=\"136\">\r\n			&nbsp;</div>\r\n	</li>\r\n	<li class=\"puntos\">\r\n		<h2 class=\"titulos_rosado twCenMt\">\r\n			S&iacute;guenos tambi&eacute;n en</h2>\r\n		<ul class=\"social\">\r\n			<li>\r\n				<a class=\"facebook\" href=\"https://www.facebook.com/ColorsTennis\" target=\"_blank\">facebook</a></li>\r\n			<li>\r\n				<a class=\"twitter\" href=\"http://twitter.com/#!/colors_tennis\" target=\"_blank\">twitter</a></li>\r\n		</ul>\r\n	</li>\r\n	<li class=\"puntos\" id=\"grupo_bb\" style=\"background:none;\">\r\n		<h3 class=\"subtitulos_gris tahoma\">\r\n			DISFRUTA DE NUESTRO GRUPO EN BLACKBERRY</h3>\r\n		<p>\r\n			Agrega nuestro pin 26C8DFF8<br />\r\n			y conoce las promociones desde tu m&oacute;vil.</p>\r\n	</li>\r\n</ul>\r\n<div style=\"clear:both\">\r\n	&nbsp;</div>\r\n','home',NULL,'2011-11-16 07:40:00'),(2,'nosotros','','',1,'pages','<div id=\"estaticas_info\">\r\n	<p>\r\n		&nbsp;</p>\r\n	<p>\r\n		&nbsp;</p>\r\n	<p>\r\n		&nbsp;</p>\r\n	<p>\r\n		&nbsp;</p>\r\n	<p>\r\n		&nbsp;</p>\r\n	<p>\r\n		&nbsp;</p>\r\n	<p>\r\n		&nbsp;</p>\r\n	<h1 class=\"titulos_rosado twCenMt\">\r\n		NOSOTROS&nbsp;</h1><span class=\"puntos\"></span>\r\n	<p>\r\n		Colors Tennis es una tienda online que brinda a marcas de moda colombianas, con una propuesta diferente, un espacio en la web para exponer y ofrecer sus productos.</p>\r\n	<p>\r\n		Somos m&aacute;s que Ropa! &nbsp;Somos una tienda para gente que en verdad le importa la apariencia. Podr&aacute;s encontrar variedad de marcas, prendas, estilos y colores. &nbsp;Si eres de los que te importa vestir bien y no usar lo de los dem&aacute;s, eres nuestro target. No importa que est&eacute;s en cualquier parte de Colombia, lo importante es que tengas la actitud, del resto nos encargamos nosotros.</p>\r\n	<p>\r\n		Ofrecemos diferentes opciones de pago como tarjetas debito, cr&eacute;dito, consignaci&oacute;n bancaria o puntos VIA BALOTO. Adicionalmente es un portal seguro y confiable.</p>\r\n</div>\r\n<div id=\"foto_estaticas\">\r\n	<img alt=\"\" src=\"/app/webroot/wysiwyg/nosotros.jpg\" style=\"width: 417px; height: 543px; \" /></div>\r\n','nosotros',NULL,'2011-11-06 12:23:51'),(3,'ayuda','','',1,'pages','<div id=\"estaticas_info\">\r\n	<h1 class=\"titulos_rosado twCenMt\">\r\n		AYUDA</h1>\r\n	<p>\r\n		&nbsp;</p>\r\n	<h2 class=\"titulos_rosado twCenMt\">\r\n		&iquest;C&oacute;mo comprar en Colors Tennis?</h2>\r\n	<p>\r\n		Tips para quienes compran por primera vez. Selecciona tu producto, busca tu talla y agrega al carrito, carga el cup&oacute;n de descuento (si lo hay) y realiza el pedido, reg&iacute;strate (Llena todos los datos solicitados,define el medio de pago y env&iacute;a el pedido. Por &uacute;ltimo imprime o guarda tu recibo de pago.</p>\r\n	<div>\r\n		<h2 class=\"titulos_rosado twCenMt\">\r\n			&iquest;Cu&aacute;les formas de pago aceptan?</h2>\r\n		<p>\r\n			Aceptamos todas las tarjetas de cr&eacute;dito de las franquicias VISA, MASTER, DINER y AMEX. Tambi&eacute;n puedes realizar el pago por medio de dep&oacute;sitos o consignaciones en efectivo y por los puntos referenciados de VIA BALOTO.</p>\r\n		<p>\r\n			&nbsp;</p>\r\n		<h2 class=\"titulos_rosado twCenMt\">\r\n			&iquest;Es seguro usar mi tarjeta d&eacute;bito o cr&eacute;dito en su sitio?</h2>\r\n		<p>\r\n			S&iacute;. Entendemos que la seguridad de tu informaci&oacute;n personal es de suma importancia para ti. Cumplimos con el est&aacute;ndar internacional de protecci&oacute;n de datos, para que tu informaci&oacute;n personal y de tarjeta de cr&eacute;dito, est&eacute; protegida de accesos no autorizados.</p>\r\n		<p>\r\n			&nbsp;</p>\r\n		<h2 class=\"titulos_rosado twCenMt\">\r\n			&iquest;Los cargos en la tarjeta debito o cr&eacute;dito vendr&aacute;n a nombre de ColorsTennis?</h2>\r\n		<p>\r\n			No. Los cargos generados en ColorsTennis aparecer&aacute;n en el resumen de tu tarjeta d&eacute;bito o cr&eacute;dito a nombre de PAGOSONLINE (www.pagosonline.com).</p>\r\n		<p>\r\n			&nbsp;</p>\r\n		<h2 class=\"titulos_rosado twCenMt\">\r\n			&iquest;Qu&eacute; es PAGOSONLINE?</h2>\r\n		<p>\r\n			PAGOSONLINE es uno de los principales proveedores de soluciones de cobranza para sitios web. Permite a individuos y empresas pagar y cobrar de forma segura y confiable.</p>\r\n		<p>\r\n			&nbsp;</p>\r\n		<h2 class=\"titulos_rosado twCenMt\">\r\n			&iquest;Qu&eacute; es un cup&oacute;n de descuento?</h2>\r\n		<p>\r\n			Un cup&oacute;n de descuento es un c&oacute;digo alfanum&eacute;rico a trav&eacute;s del cual puedes acceder a un descuento especial. Los cupones se ingresan en el carrito de compras, paso previo a iniciar el proceso de pago.</p>\r\n		<p>\r\n			&nbsp;</p>\r\n		<h2 class=\"titulos_rosado twCenMt\">\r\n			&iquest;Cu&aacute;les son los beneficios de tener una cuenta con Uds?</h2>\r\n		<p>\r\n			Al crear una cuenta en nuestra tienda, acceder&aacute;s a estos beneficios: - Comprar m&aacute;s r&aacute;pido y f&aacute;cil - Guardar m&uacute;ltiples direcciones de pago y env&iacute;o - Acceder a ofertas exclusivas - Seguimiento del estado de tus pedidos - Consultar el historial de tus pedidos - Atenci&oacute;n al cliente personalizada.</p>\r\n		<p>\r\n			&nbsp;</p>\r\n		<h2 class=\"titulos_rosado twCenMt\">\r\n			&iquest;Cu&aacute;l es su pol&iacute;tica de env&iacute;os y devoluciones?</h2>\r\n		<p>\r\n			Creemos que comprar por internet tiene que ser algo f&aacute;cil y simple. El envi&oacute; de nuestros productos a ciudades diferentes a Cali se hace a trav&eacute;s de una empresa reconocida de transporte nacional. El producto se puede cambiar gratuitamente la primera vez (inconvenientes con la talla o por garant&iacute;a). Si existe una devoluci&oacute;n por segunda vez los gastos de envi&oacute; son asumidos por ti.</p>\r\n		<p>\r\n			&nbsp;</p>\r\n		<h2 class=\"titulos_rosado twCenMt\">\r\n			&iquest;C&oacute;mo puedo obtener ayuda en caso de necesitarla?</h2>\r\n		<p>\r\n			Para poder brindarte un buen servicio de atenci&oacute;n al cliente, contamos con varios medios para que nos contactes: Telef&oacute;nicamente de Lunes a Viernes de 8.30 am a 6 pm al 313 743 01 19. V&iacute;a Chat A trav&eacute;s de nuestro perfil en Facebook de atenci&oacute;n al cliente www.facebook.com/ColorsTennisAAC &oacute; por Correo Electr&oacute;nico de atenci&oacute;n al cliente: aac@colorstennis.com.</p>\r\n		<p>\r\n			&nbsp;</p>\r\n		<h2 class=\"titulos_rosado twCenMt\">\r\n			&iquest;Cu&aacute;l es el costo de env&iacute;o?</h2>\r\n		<p>\r\n			Los costos de envi&oacute; lo estipula la empresa transportadora de mercanc&iacute;a, dependiendo de la ciudad de destino y del tama&ntilde;o del paquete. El pago lo realiza el cliente contraentrega. La entrega de pedidos en la ciudad de Cali no tiene costo de env&iacute;o. Si el cliente realiza compras en nuestra tienda iguales o superiores a $120.000 el costo de env&iacute;o es totalmente gratis.</p>\r\n		<p>\r\n			&nbsp;</p>\r\n		<h2 class=\"titulos_rosado twCenMt\">\r\n			&iquest;Cu&aacute;l es el tiempo de entrega?</h2>\r\n		<p>\r\n			El tiempo aproximado de entrega del producto es entre 3 y 6 d&iacute;as.</p>\r\n		<p>\r\n			&nbsp;</p>\r\n		<h2 class=\"titulos_rosado twCenMt\">\r\n			&iquest;Si compro m&aacute;s de un producto, tendr&eacute; que pagar el env&iacute;o por cada uno de ellos?</h2>\r\n		<p>\r\n			No. Se hace un solo paquete en el cual se encuentran todos los productos que el cliente adquiere, de esta manera la transportadora cobrar&aacute; de acuerdo al tama&ntilde;o y peso de un &uacute;nico paquete.</p>\r\n		<p>\r\n			&nbsp;</p>\r\n		<h2 class=\"titulos_rosado twCenMt\">\r\n			&iquest; Cu&aacute;l es el costo de env&iacute;o de mi casa a su dep&oacute;sito si quiero devolver un pedido?</h2>\r\n		<p>\r\n			No tiene costo alguno si es devoluci&oacute;n del producto por garant&iacute;a. Revisar el siguiente punto si es para cambios.</p>\r\n		<p>\r\n			&nbsp;</p>\r\n		<h2 class=\"titulos_rosado twCenMt\">\r\n			&iquest;Cu&aacute;l es el costo de env&iacute;o de mi casa a su dep&oacute;sito si quiero cambiar un pedido?</h2>\r\n		<p>\r\n			Cambiar por primera vez cualquier producto que hayas comprado en Colors Tennis es GRATIS, salvo en los casos que se diga expresamente lo contrario.</p>\r\n		<p>\r\n			&nbsp;</p>\r\n		<h2 class=\"titulos_rosado twCenMt\">\r\n			&iquest;Tienes m&aacute;s dudas?</h2>\r\n		<p>\r\n			Puedes comunicarte con un asesor de servicio al cliente por medio de skype. La llamada es totalmente gratis. Tambi&eacute;n puedes chatear con un asesor por medio de nuestro perfil en facebook</p>\r\n<!--\r\nSkype \'Skype Meâ„¢!\' button\r\nhttp://www.skype.com/go/skypebuttons\r\n--><script type=\"text/javascript\" src=\"http://download.skype.com/share/skypebuttons/js/skypeCheck.js\"></script>		<a href=\"skype:georgece007?call\"><img alt=\"Skype Meâ„¢!\" height=\"82\" src=\"http://download.skype.com/share/skypebuttons/buttons/call_green_white_92x82.png\" style=\"border: none;\" width=\"92\" /></a>&nbsp; &nbsp;&nbsp;<a href=\"http://www.facebook.com/ColorsTennisAAC\" target=\"_blank\"><img alt=\"\" src=\"/app/webroot/wysiwyg/facebook_logo.png\" style=\"width: 92px; height: 82px; \" /></a></div>\r\n	<p>\r\n		&nbsp;</p>\r\n</div>\r\n<div id=\"foto_estaticas\">\r\n	<img alt=\"\" src=\"/app/webroot/wysiwyg/contacto.jpg\" /></div>\r\n','ayuda',NULL,'2011-11-22 07:04:33'),(4,'contacto',NULL,NULL,NULL,'pages',NULL,'contacto',NULL,NULL);
